    "content": "<p>Polis larmas till en lägenhet i Bålsta där en man uppges vara utsatt för brott. I lägenheten påträffas utöver en målsägande även tre män i 20-årsåldern som grips. De tre männen misstänks ha hållit målsägande mot sin vilja i lägenheten i samband med ett utpressningsärende. På platsen påträffas och beslagtas en modifierad startpistol och andra tillhyggen.</p>\n<p>De tre gripna männen blir föremål för en förundersökning om olaga frihetsberövande, olaga hot, grovt vapenbrott, misshandel och utpressning. Samtliga inblandade är sedan tidigare kända av polisen.</p>",
