    "content": "<p>Samtal inkom klockan 09.22 om att en person knivskadats inomhus på ett företag i Ulvsunda. Då polis kom till platsen påträffades en utpekad gärningsman som nu är gripen.</p>\n<p>Den knivskadade personen är förd med ambulans till sjukhus, okänt skadeläge i nuläget. Den aktuella brottsplatsen är avspärrad. Händelsen rubriceras som försök till mord.</p>\n<p><strong>Uppdatering klockan 10.12</strong><br />Polis pratar med vittnen för att få information om händelsen. Både den gripne och den skadade är män.</p>\n<p><strong>Uppdatering klockan 10.56</strong><br />Den skadade personen uppges vara vaken och talbar.</p>",
