    "content": "<p>Två personer har omhändertagits för fylleri, en av dem överlämnades till sjukvård. Polisen har även utfört ett flertal kontroller av personer och fordon som inte resulterat i någon brottsmisstanke.</p>\n<p>Nedan finns en länk till en tidigare notis angående ett ärende i Kramfors/Örnsköldsvik i natt. </p>\n<p><strong>Här följer ett urval av nattens händelser:</strong></p>\n<p><strong>01:03 Trafikbrott, Örnsköldsvik</strong><br />Polisen stoppar och kontrollerar en personbil på Björnavägen. Föraren får en ordningsbot då bilen har körförbud. </p>\n<p><strong>03:37 Narkotikabrott, Sollefteå</strong><br />Polisen kontrollerar två personer vid en stillastående bil i en mindre ort efter länsväg 331 utanför Sollefteå. Misstanke uppstår om att en av dem, en man, är påverkad av narkotika. Han tas med för provtagning. En anmälan gällande ringa narkotikabrott genom eget bruk upprättas. </p>\n<p><strong>Övrigt:</strong> En viltolycka har inträffat i länet under sen kväll, i Härnösands kommun. Ingen person kom till skada. </p>",
