    "content": "<p>Det har varit en natt med få ärenden i Jämtlands län. Polisen har utöver nedanstående ärenden även utfört ett flertal kontroller av personer och fordon som inte resulterat i någon brottsmisstanke.</p>\n<p>Här följer ett urval av nattens händelser:</p>\n<p><strong>22:56 Bedrägeri, Åre</strong><br />Polisen beordras till en restaurang i Åre med anledning av att en minderårig pojke har visat upp en manipulerad legitimation. När patrullen kommer till platsen är han inte kvar. En anmälan upprättas gällande urkundsförfalskning och brukande av falsk urkund.</p>\n<p><strong>02:06 Misshandel, Åre</strong><br />Polisen får ett samtal om ett bråk utomhus i centrala Åre. Ett tiotal personer ska ha varit inblandade i bråket. Minst tre av dem ska ha fått motta bland annat slag från en okänd gärningsperson. Polispatrull tar upp anmälan gällande två fall av misshandel och ett gällande ringa misshandel.</p>\n<p><strong>Övrigt:</strong> En viltolycka har inträffat i Jämtland under sen kväll, i Strömsunds kommun. Ingen person kom till skada.</p>\n",
