    "description": "Ett urval av händelser sedan klockan 22 i går kväll.",
    "content": "<p>Polisen i Södermanlands län har hanterat ett 40-tal händelser sedan klockan 22 i går kväll. Ingen person har gripits eller omhändertagits.</p>\n<p><strong>23.19 Trafikbrott, Eskilstuna</strong><br /> En polispatrull stannade en bilist för kontroll i Nyfors, då man observerat hur föraren pratade i en handhållen mobiltelefon. Föraren, en man i 25-årsåldern, fick en ordningsbot på 1500 kronor.</p>\n<p><strong>03.37 Brand, Katrineholm</strong><br /> Brand i personbil på Prinsgatan. En inringare hade sett en bil stå och brinna med öppna lågor. Polis var först på plats och då rök det bara ur bilen. Omständigheterna var sådana att det finns starka misstankar att branden varit anlagd, men den hade aldrig tagit sig och bilen blev därmed inte totaltförstörd. Polisen har tagit ett antal föremål vid bilen i beslag och upprättat en anmälan om mordbrand, på grund av högt värde på bilen.</p>",
