    "description": "Man knivskuren av okänd person, Hyltarpsvägen.",
    "content": "<p>En man i 20-årsåldern ska ha blivit oprovocerat angripen på Hyltarpsvägen. Mannen var på väg hem när en personbil av typen svart halvkombi stannade till och en för honom okänd person hoppade ut. Den okända personen ska ha misshandlat och knivskurit mannen och därefter lämnat platsen. Målsägande tar sig hem och kontaktar polis med hjälp av anhörig. Polis skickas till adressen för att höra mannen och en anmälan om misshandel upprättas. Mannen har inte varit i behov av sjukhusvård. Ingen misstänkt är i nuläget gripen.</p>",
