    "title_type": "Sammanfattning natt",
    "title_location": "Kramfors",
    "description": "Tillgrepp av fortskaffningsmedel Kramfors/Örnsköldsvik",
    "content": "<p>01:05 Försöker en patrull stoppa en bil i Kramfors kommun. Föraren vill inte stanna på polismans tecken och bilen är dessutom stulen. Polisen förföljer bilen och får stopp på bilen i Örnsköldsviks Kommun, med hjälp av spikmatta. Två personer i 45 års åldern grips på platsen och är misstänkta för tillgrepp av fortskaffningsmedel. De gripna är i 45 års åldern. Bilen är tilllgripen i Västerbotten. Gripandet och stoppet gick lungt tillväga.</p>\n<p>Föraren saknade körkort och misstänks för grovolovlig körning, rattfylleri och vårdslöshet i trafik. Passageraren var efterlyst för att avtjäna fängelsestraff.</p>\n",
