    "description": "Anlagd brand i Gottsunda kyrka, Uppsala",
    "content": "<p>Patrullerande polispatrull upptäckte strax innan midnatt att någon anlagt brand på fasaden till Gottsunda kyrka. Patrullen försökte direkt släcka branden, som hade spridit sig flera meter upp på fasaden, med handbrandsläckare, utan att lyckas.</p>\n<p>Räddningstjänst rekvirerades som efter ett tag kunde få branden under kontroll.</p>\n<p>En anmälan om grov skadegörelse genom brand är upprättad och polisen har i samband med insatsen säkrat en del beslag samt kontrollerat en del människor i närområdet. I nuläget finns ingen misstänkt.</p>\n<p>Branden hade kunnat orsakat mycket omfattande skador om inte polispatrull upptäckt den i ett så tidigt skede.</p>",
