    "description": "En bil har kraschat i skogen, men inga personer finns kvar vid fordonet.",
    "content": "<p>Via SOS meddelas polis, räddningstjänst och ambulans om att en bil kört av riksväg 69 i höjd med Harbo. Bilen har voltat och kraschat in i ett träd. När polis anländer till olycksplatsen finns inga personer som färdats i bilen kvar på platsen. Med utgångspunkt från hur skadad bilen kan personerna från bilen tänkas vara skadade. Polisen kontrollerar om sjukvården har fått in några skadade personer, men det har man inte.<br />Efter ett kortare utredningsarbete får polisen fram namn på två personer som kan ha färdats i bilen. Det rör sig om två pojkar i tonåren (15 till 18-årsåldern, ingen av dem har fyllt 18). De båda pojkarna hittas av en patrull i närheten av olycksplatsen.<br />Båda två förs till sjukhus med ambulans.<br />Polisen skriver anmälningar om olovlig körning, vårdslöshet i trafik och vållande till kroppskada.</p>",
