    "description": "Lägenhetsbrand i flerfamiljshus i centrala Grums.",
    "content": "<p>Enligt initiala uppgifter har det brunnit i en kartong i köket till lägenheten men de boende har själva släckt elden. Lägenheten är rökfylld varför de boende har tagit sig ut ur fastigheten.</p>\n<p>Raäddningstjänst är på plats och vädrar ur lägenheten. De boende uppges inte vara skadade.</p>\n<p>Ambulans och polis är på väg till platsen.</p>\n<p>UPPDATERING: Polisen har upprättat en nmälan om allmänfarlig vårdslöshet.</p>",
