    "description": "En man misstänks ha utsatts kraftig våld.",
    "content": "<p>En skadad man hittas av allmänhet i en trappuppgång på Skallberget. Mannens skador är av sådant slag att polisen misstänker att mannen utsatts för kraftigt våld av en annan person.<br />Flera patruller och ambulans larmas till adressen.<br />Den skadade mannen förs till sjukhus. Händelsen rubriceras som mordförsök och i nuläget kommenterar polisen inte mannens skador ytterligare.<br /><br />Ca kl 14:45 trycker personal i ett närliggande apotek på ett överfallslarm på grund av en situation som uppstått i apoteket.<br />Vilket slags situation det rör sig om kommenteras inte närmare, men polisen arbetar parallellt med båda händelserna och det går inte att utesluta att det finns en koppling till händelsen i trappuppgången.  <br /><br /><strong>Uppdatering kl 20:55</strong></p>\n<p>Under eftermiddagen griper polisen en man i 45-årsåldern. Åklagare anhåller senare på kvällen mannen som som skäligen misstänkt för försök till mord.<br />I nuläget riktas inga misstankar mot några andra personer.<br />Mannen som skadades vid händelsen är kritiskt skadad.</p>\n",
