    "description": "Uppdatering om brand i fastighet utanför Mjölby.",
    "content": "<p>Polisen har under måndagen genomfört en teknisk undersökning i den sommarstuga som brann ner natten till söndagen vid Skogssjön. Efter att ha sökt med hund vid huset så finns det inga indikationer på att branden skulle ha varit anlagd. Polisen har också fått tag i stugägaren, så det finns inte längre någon misstanke om att någon skulle ha omkommit i branden.</p>\n<p>---</p>\n<p><strong>Text från söndagsmorgonens nattsammanfattning:</strong></p>\n<p>03.08 Brand, Mjölby<br />Räddningstjänst och polis larmades till en brinnande sommarstuga vid Skogssjön i Mjölby kommun. Stugan helt övertänd när räddningstjänst kom fram till platsen. Det är oklart vem som kan ha bott i/använt stugan. En förundersökning om mordbrand har inletts och platsen spärrats av för en teknisk undersökning.<br /><strong>Uppdatering kl 11.15:</strong><br />Brottsrubriceringen är nu grov mordbrand. Polisen håller fortfarande på och undersöker vem som kan ha haft tillgång till stugan den gångna natten. Platsen är avspärrad och bevakad i väntan på att temperaturen ska sjunka så att en teknisk undersökning kan genomföras. En sådan kommer genomföras under söndagen eller måndagen. Polisen är intresserad av iakttagelser i det aktuella området runt 3-tiden i natt. Den som befunnit sig i området, eller har andra upplysningar som kan vara av intresse, uppmanas att ringa 114 14.</p>",
