    "title_location": "Umeå",
    "description": "Snö från lastbil krossade bilruta på E12 mellan Obbola och Umeå.",
    "content": "<p>Polisen kontaktades på måndagsmorgonen gällande en bilist som fått sin bilruta krossad av is eller kompakt snö som fallit ner från en lastbil vid möte. Olyckan inträffade på E12 mellan Obbola och Umeå.</p>\n<p>Lastbilschauffören fick en ordningsbot (böter) på 1500 kronor på grund av osäkrad last - det vill säga snön/isen på lastbilen. </p>\n<p><strong>OBS: Tidigare uppgavs att ordningsboten var på 4000 kronor, vilket var felaktigt. Den rätta summan är 1500 kronor. </strong></p>",
