    "description": "Ett urval av nattens polisverksamhet.",
    "content": "<p>Det har varit en natt med lår arbetsbelastning. Polisen har även utfört ett flertal kontroller av personer och fordon som inte resulterat i någon brottsmisstanke.</p>\n<p><strong>Här följer ett urval av nattens händelser:</strong></p>\n<p>Mellan klockan 22.00 och 07.30 har 13 viltolyckor inträffat i Jämtlands län. Det finns inga uppgifter om att någon person har kommit till skada. Olyckorna har rapporterats in enligt nedan.</p>\n<p>Klockan 22:25 Rådjursolycka på Skolgatan/Åsgatan, Vemdalen i Härjedalen.</p>\n<p>Klockan 22:36 Rådjursolycka på E45 vid Fåker-Näs, Östersund.</p>\n<p>Klockan 22:43 Rådjursolycka vid Havnäs, Strömsund.</p>\n<p>Klockan 22:53 Rådjursolycka vid Aspåsnäset, Krokom.</p>\n<p>Klockan 23:23 Rådjursolycka i Värmon, Krokom. </p>\n<p>Klockan 05:05 Rådjursolycka på länsväg 751 Husås-Ringsta, Östersund.</p>\n<p>Klockan 05:14 Rådjursolycka på länsväg 619, Vaplan, Krokom.</p>\n<p>Klockan 05:48 Rådjursolycka på länsväg 757 Störåsen, Krokom.</p>\n<p>Klockan 05:52 Rådjursolycka på E14 Tängtorpet-Åskorset.</p>\n<p>Klockan 06:06 Älgolycka på länsväg 321 i Halabacken, Åre. Polisen har varit på plats och så även räddningstjänst och ambulans. Det finns inga uppgifter om att några personskador har uppkommit. Älgen har tagits bort från platsen och bilen ska/har flyttats till en parkeringsficka i närheten i väntan på bärgning.</p>\n<p>Klockan 06:38 Renolycka på länsväg 837 Görvik-Sörviken, Strömsund.</p>\n<p>Klockan 07:00 Älgolycka på länsväg 340 mellan Valsjöbyn och Klintaberg, Krokom.</p>\n<p>Klockan 07:25 Rådjursolycka på länsväg 321 Marby-Myrviken, Åre. </p>\n\n<p><strong>Så kan du minimera risken för viltolyckor</strong></p>\n<p><strong>Anpassa hastigheten</strong><br />Din hastighet är direkt avgörande för hur allvarligt det behöver bli när ett djur kliver upp på vägen. Har du anpassat din hastighet till underlag och din sikt?</p>\n<p><strong>Anpassa avståndet</strong><br />Ligger du för nära fordonet framför minskar ditt vidvinkelseende och får svårare att se rörelser i skogsbrynet.</p>\n<p><strong>Lär dig om djurens beteende</strong><br />Finns det mer olycksdrabbade sträckor där du ska åka? Har du extra koll i gryning och skymning? Läs på om tips via viltolycka.se.</p>\n",
