    "description": "Ett urval av nattens polisverksamhet klockan 22.00 till 07.00.",
    "content": "<p>Det har varit en natt med låg arbetsbelastning. Polisen har även utfört ett flertal kontroller av personer och fordon som inte resulterat i någon brottsmisstanke.</p>\n<p>Här följer ett urval av nattens händelser:</p>\n<p><strong>22:09 Trafikkontroll, Skellefteå</strong><br />Polisen upprättar en trafikkontroll på Skeppargatan/Storgatan i centrala Skellefteå. Cirka 10 bilar kontrollerades och samtliga kunde passera utan anmärkning.</p>\n<p><strong>01:13 Trafikolycka, Vännäs</strong><br />Polisen larmas om en singelolycka på länsväg 554 mellan Strand, Vännäs och Överboda, Umeå. En personbil har voltat. Två personer färdades i bilen, de förs med ambulans till sjukvård för kontroll. Det uppges vara mycket halt på platsen. Polisen misstänker inget brott i samband med olyckan. </p>\n<p><strong>Övrigt:</strong> Två viltolyckor har inträffat i länet under natt och tidig morgon, en i Skellefteå kommun och en i Lycksele kommun. Ingen person har kommit till skada. </p>",
    "content_formatted": "<p><p>Det har varit en natt med låg arbetsbelastning. Polisen har även utfört ett flertal kontroller av personer och fordon som inte resulterat i någon brottsmisstanke.</p></p><p><p>Här följer ett urval av nattens händelser:</p></p><p><p><strong>22:09 Trafikkontroll, Skellefteå</strong><br />Polisen upprättar en trafikkontroll på Skeppargatan/Storgatan i centrala Skellefteå. Cirka 10 bilar kontrollerades och samtliga kunde passera utan anmärkning.</p></p><p><p><strong>01:13 Trafikolycka, Vännäs</strong><br />Polisen larmas om en singelolycka på länsväg 554 mellan Strand, Vännäs och Överboda, Umeå. En personbil har voltat. Två personer färdades i bilen, de förs med ambulans till sjukvård för kontroll. Det uppges vara mycket halt på platsen. Polisen misstänker inget brott i samband med olyckan. </p></p><p><p><strong>Övrigt:</strong> Två viltolyckor har inträffat i länet under natt och tidig morgon, en i Skellefteå kommun och en i Lycksele kommun. Ingen person har kommit till skada. </p></p>",
