    "description": "Dagens presstalesperson är Christer Fuxborg och till kvällen kommer Ulla Brehm.",
    "content": "<p><strong>20.02 Halmstad, olaga intrång.</strong><br />Ett vaktbolag ser hur några rör sig inne på ett inhägnat område och rycker i dörrarna till parkerade bilar som tillhör PEAB på Svetsaregatan. Polis samt väktare till platsen som kan konstatera att det är ett uppklippt hål i staketet. Man kontrollerar två personer men de verkar inte vara samma personer som varit inne på området. Ingen åverkan på någon bil varför man skriver en anmälan om olaga intrång, ingen gripen.</p>\n<p><strong>22.35 Falkenberg, försök till stöld.</strong><br />Ett kameralarm går från en byggnad på Ätrastigen tillhörande ett företag. Polis samt väktare till platsen som hittar en utslagen ruta men ingen person kvar på platsen. Man söker igenom fastigheten men ingen person är kvar. Oklart om vad som stulits i skrivande stund.</p>\n<p><strong>22.57 Varberg, stöld.</strong><br />Ett kameralarm går från Holmagärde där det pågår en dieselstöld från ett arbetsfordon som står parkerad inom området. Polis skickas till platsen som påbörjar spårning med hjälp av hund. Man hittar ganska omgående ett par vantar som troligen tillhör tjuven. Efter ytterligare spårning påträffar man även en misstänkt man som kommer från området. Mannen grips och han får följa med tillbaka till området. Mannen får följa med till stationen för vidare förhör.</p>",
