    "content": "<p>06.02 polisen har hittills detta dygn hanterat ett 15-tal rutinärenden, huvudsakligen utan brottsmisstankar. Ingen har frihetsberövats under denna tid.</p>\n<p>03.06 SOS-larm till polisen om brand utomhus på Landshammarsgatan i Gnesta. Det visade sig vara en transportbil som brann. Polisen har påbörjat en utredning om skadegörelse genom brand, eftersom branden misstänks vara anlagd.</p>\n<p>Verksamheten har i stort sett bestått av olika typer av kontroller, många trafikrelaterade. Ingen av dessa har resluterat i några brottsmisstankar.</p>\n\n\n",
