    "content": "<p>06.08 polisen har hittills detta dygn hanterat ett 20-tal rutinärenden, huvudsakligen utan brottsmisstankar. Ingen har gripits eller omhändertagits men en person har fått följa med för provtagning på grund av misstänkt drogpåverkan.</p>\n<p>03.10 vid en rutinkontroll av en bilist på E4 vid Melbyavfarten uppstod en misstanke om drograttfylleri. En man i 40-årsåldern fick följa med för provtagning, misstänkt för drograttfylleri och grov olovlig körning.</p>\n<p>Det finns inga andra brott eller allvarliga händelser att rapportera om.</p>\n",
