    "description": "Grovt olaga hot, Järlåsa",
    "content": "<p>Vid 03.15-tiden kontaktade en boende utanför Järlåsa polisen efter att en man ringt på dörren och hotat anmälaren med ett pistolliknande föremål. Mannen uppgav att han var ute efter en annan person som var skyldig honom pengar.</p>\n<p>Målsägande och misstänkt skall inte ha känt varandra.</p>\n<p>Flertalet polispatruller samt hundpatrull beordrades till platsen. Den misstänkte gärningspersonen, en man i 55-årslåldern, kunde med allmänhetens hjälp lokaliseras, inte långt från brottsplatsen, ca 1 tim och 50 min senare.</p>\n<p>Mannen var vid gripandetillfället beväpnad med yxa men kunde betvingas med hjälp av bl.a. pepparspray.</p>\n<p>Brottsrubriceringen i nuläget är grovt olaga hot samt skadegörelse.</p>",
    "content_formatted": "<p><p>Vid 03.15-tiden kontaktade en boende utanför Järlåsa polisen efter att en man ringt på dörren och hotat anmälaren med ett pistolliknande föremål. Mannen uppgav att han var ute efter en annan person som var skyldig honom pengar.</p></p><p><p>Målsägande och misstänkt skall inte ha känt varandra.</p></p><p><p>Flertalet polispatruller samt hundpatrull beordrades till platsen. Den misstänkte gärningspersonen, en man i 55-årslåldern, kunde med allmänhetens hjälp lokaliseras, inte långt från brottsplatsen, ca 1 tim och 50 min senare.</p></p><p><p>Mannen var vid gripandetillfället beväpnad med yxa men kunde betvingas med hjälp av bl.a. pepparspray.</p></p><p><p>Brottsrubriceringen i nuläget är grovt olaga hot samt skadegörelse.</p></p>",
