    "content": "<p>Tumult uppstod mellan en cyklist och en förare till en personbil vid ca kl 13 under söndagen i området Vallhov i Sandviken. Under tumultet blev bilisten skadad i bröstet av cyklisten genom ett hugg med ett okänt föremål. <br /><br />Polis beordrades till platsen och anmälan om försök till mord och olaga hot upprättades. Den skadade bilisten fördes med ambulans till sjukhus med en ej allvarlig skada. Efter utredningsarbete under eftermiddagen anhölls en person i sin utevaro av åklagare. Personen greps strax före kl 19 och är fortsatt anhållen.<br /><br /></p>\n",
