    "title_location": "Uppsala",
    "description": "Grov misshandel, misshandel samt rån i centrala Uppsala",
    "content": "<p>Vid 18.20 tiden mottog polisen flera samtal om oroligheter i Stadsparken i centrala Uppsala. Ett större ungdomsgäng beväpnade med tillhyggen var på väg in i parken för att göra upp med en annan ungdomskonstellation.</p>\n<p>Polisen var snabbt på plats och kunde skingra kombatanterna. I samband med detta tränger sig några personer in på ett inhägnat område. Då dessa skall kontrolleras av polis uppstår tumult och polis får i samband med detta använda sig av s.k. OC-spray för att få kontroll på situationen.</p>\n<p>Flertalet personer kontrolleras och polis kan konstatera att flera av ungdomarna har synliga skador vilket man tror härrör från slagsmål. Ingen vill dock medverka i någon polisutredning.</p>\n<p>En stund senare inkommer en person i 20-årsåldern till Akademiska sjukhuset med en stickskada i rumpan. Ej heller denna person vill medverka och berätta för polis vad som inträffat. Arbetshypotesen från polisens sida är att denna stickskada uppkommit i samband med bråket i Stadsparken.</p>\n<p>Händelsen har renderat i anmälningar om grov misshandel samt olaga intrång. </p>\n<p>Ca en timme senare inkom ytterligare larm om bråk utanför Willys på Kungsgatan. Polis på plats kan kontatera att denna händelse troligtvis är en fortsättning på bråket i stadsparken. Denna händelse har renderat i en anmälan gällande misshandel samt rån, då personer på plats blivit misshandlade samt en person blivit av med sin mobiltelefon.</p>\n<p>Inga personer är frihetsberövade i nuläget.</p>\n\n",
