    "description": "Polisen omhändertar/beslagtar flera handeldvapen från en man.",
    "content": "<p>En man i 50-årsåldern ringer först till polisen och berättar att han skjutit någonstans och kommer något senare till polishuset och upprepar samma berättelse.<br />Mannen är mycket berusad och någon klar bild av varför mannen skjutit framkommer inte.<br />Med hjälp av mannen hittar polisen till ett handeldvapen som ägs av mannen och som han har licens för. Nu ligger vapnet slängt på en åker utanför Vänge.<br />Vid fyndplatsen finns även en vägskylt med skotthål i.<br />Vapnet tas i beslag av polisen på grund av misstänkt brott mot vapenlagen (genom att på ett vårdslöst sätt hanterat vapen i allmän miljö).<br /><br />Mannen är bosatt i Uppsala och när polisen går igenom mannens vapenskåp hittas två handeldvapen som han har licens för. Dessa vapen omhändertas tillsvidare.<br />I skåpet finns även två handeldvapen av äldre modell, men som ändå är licenspliktiga. Dessa tas i beslag.<br /><br />Under arbetet har mannen gripits men släpps senare efter åklagarkontakt. <br />Polisen har i dagsläget inga misstankar om att någon person ska ha befunnit sig i fara eller skadats i samband med händelsen.<br /></p>",
    "content_formatted": "<p><p>En man i 50-årsåldern ringer först till polisen och berättar att han skjutit någonstans och kommer något senare till polishuset och upprepar samma berättelse.<br />Mannen är mycket berusad och någon klar bild av varför mannen skjutit framkommer inte.<br />Med hjälp av mannen hittar polisen till ett handeldvapen som ägs av mannen och som han har licens för. Nu ligger vapnet slängt på en åker utanför Vänge.<br />Vid fyndplatsen finns även en vägskylt med skotthål i.<br />Vapnet tas i beslag av polisen på grund av misstänkt brott mot vapenlagen (genom att på ett vårdslöst sätt hanterat vapen i allmän miljö).<br /><br />Mannen är bosatt i Uppsala och när polisen går igenom mannens vapenskåp hittas två handeldvapen som han har licens för. Dessa vapen omhändertas tillsvidare.<br />I skåpet finns även två handeldvapen av äldre modell, men som ändå är licenspliktiga. Dessa tas i beslag.<br /><br />Under arbetet har mannen gripits men släpps senare efter åklagarkontakt. <br />Polisen har i dagsläget inga misstankar om att någon person ska ha befunnit sig i fara eller skadats i samband med händelsen.<br /></p></p>",
