    "description": "Ett urval av nattens polisverksamhet.",
    "content": "<p>Klockan 00-08, det har varit en natt med normal arbetsbelastning. Fem personer har omhändertagits för fylleri. Polisen har även utfört ett flertal kontroller av personer och fordon som inte resulterat i någon brottsmisstanke.</p>\n<p>Här följer ett urval av nattens händelser:</p>\n<p><strong>00:02 Brand, Haparanda</strong><br />En patrull beordrades till en adress på Tjärhovet i Haparanda med anledning av brand. Räddningstjänsten släckte branden. En anmälan gällande allmänfarlig vårdslöshet upprättas initialt, men ingen misstänks för brott.</p>\n<p><strong>01:51 Trafikbrott, Luleå</strong><br />En patrull stoppade och kontrollerade en personbil i Gammelstad. Föraren saknade godkänt körkort och misstänks därmed för olovlig körning. En anmälan gällande detta upprättas.</p>\n<p><strong>03:35 Trafikolycka, Piteå</strong><br />En trafikolycka inträffade på Hammarvägen i Öjebyn, Piteå. En personbil hade fått sladd och körts av vägen. En person förs till sjukvård. Polis har hållit förhör och upprättar en anmälan om trafikolycka.</p>\n<p>Två viltolyckor har anmälts till polisen under natten och morgonen. Ingen person skadades i samband med olyckorna.</p>",
