    "title_type": "Mord/dråp",
    "title_location": "Örebro",
    "description": "Mord, Örebro",
    "content": "<p>En person har under söndagsmorgonen hittats död i Örebro. Omständigheterna kring dödsfallet gör att en förundersökning om mord har inletts. Polisen har spärrat av fyndplatsen och vädjar till allmänheten att respektera avspärrningarna. Tekniker och hundpatruller är tillkallade och kommer att inleda brottplatsundersökning inom kort. Personer som har uppgifter eller har iakttagelser som kan vara av betydelse för utredningen ombeds kontakta polisen på telefon 114 14.</p>\n<p>Händelsen kommer att uppdateras.</p>\n<p>Uppdatering 09.10</p>\n<p>Personen som hittats död har hittats utomhus i Örebro. Anhöriga är ännu inte underrättade. Omständigheterna och den avlidnes skador är anledningen till att förundersökning om mord inletts. </p>\n<p>UPPDATERING 13.27</p>\n<p>Mannen som hittats avliden och misstänkt mördad är i sextioårsåldern och hemmahörande i Örebro. Avspärrningarna kring fyndplatsen har utökats i syfte att säkerställa fler spår. Anhöriga är fortfarande ännu inte underrättade. Tills vidare kommer inte fler uppgifter att lämnas i ärendet. Så snart läget tillåter kommer vi att uppdatera kring händelsen.</p>",
