    "description": "Ett urval av händelser sedan klockan 22 i går kväll.",
    "content": "<p>Polisen i Södermanlands län har hanterat ett 80-tal händelser sedan klockan 22 i går kväll. Ingen person har gripits, åtta personer har omhändertagits för fylleri eller andra ordningsstörningar.</p>\n<p><strong>01.32 Misshandel, Eskilstuna</strong><br /> Två skadade personer kom in till akuten, båda hade skador som kunde tyda på att de blivit knivskurna. De drabbade är båda män i 25-årsåldern. Förundersökning inledd på grov misshandel i ett fall och försök till mord i det andra. Skadeläget för de två drabbade är oklart. Det fanns på söndagsmorgonen ingen frihetsberövad i ärendet. Ärendet leds nu av åklagare.<br />Misstänkt brottsplats är utomhus i centrala Eskilstuna, nära Kungsplan. Polisen söker vittnen som har sett bråket som inträffat mellan klockan 01.00 och 01.30 utanför en snabbmatsrestaurang. <br />Den som har upplysningar kan ringa polisen och tipsa på 114 14.</p>\n<p><strong>Uppdatering kl 12.00:<br /></strong>En person sitter nu anhållen, misstänkt för den grova misshandeln och mordförsöket som inträffade i centrala Eskilstuna i natt. Den anhållne är en man i 20-årsåldern. Utredningsarbetet fortgår med att höra vittnen och göra andra utredningsåtgärder som kan vara av intresse för den fortsatta utredningen. Polisen är fortsatt intresserade av att komma i kontakt med personer som befunnit sig vid den aktuella platsen mellan klockan 01.00 och 01.30 i natt.</p>",
