    "description": "Ett urval av händelser i länet sedan klockan 22 i går kväll.",
    "content": "<p>Polisen i Östergötlands län har hanterat ett 110-tal händelser sedan klockan 22 i går kväll. Fyra personer har gripits, se händelser nedan, samt sex personer omhändertagits för fylleri eller andra ordningsstörningar.</p>\n<p><strong>00.38 Tillgrepp av fortskaffningsmedel, Linköping</strong><br /> En polispatrull stoppade en bil för kontroll i Berg, Linköping. Bilen var falskskyltad och visade sig efter kontroll vara anmäld stulen sedan den 19 december. De två personer som satt i bilen, en man i 35-årsåldern och en kvinna i 25-årsåldern, greps misstänkta för tillgrepp av fortskaffningsmedel.</p>\n<p><strong>03.06 Misshandel, Norrköping</strong><br /> En man i 20-årsåldern blev misshandlad utomhus vid ett gatukök på Sankt Persgatan. Målsäganden fick följa med ambulans till sjukhus för kontroll och hördes där av polis. En person har gripits för misshandeln, även det en man i 20-årsåldern. Han är misstänkt för grov misshandel. Ärendet leds av åklagare.</p>\n<p><strong>03.08 Brand, Mjölby</strong><br /> Räddningstjänst och polis larmades till en brinnande sommarstuga vid Skogssjön i Mjölby kommun. Stugan helt övertänd när räddningstjänst kom fram till platsen. Det är oklart vem som kan ha bott i/använt stugan. En förundersökning om mordbrand har inletts och platsen spärrats av för en teknisk undersökning.<br /><strong>Uppdatering kl 11.15:</strong><br />Brottsrubriceringen är nu grov mordbrand. Polisen håller fortfarande på och undersöker vem som kan ha haft tillgång till stugan den gångna natten. Platsen är avspärrad och bevakad i väntan på att temperaturen ska sjunka så att en teknisk undersökning kan genomföras. En sådan kommer genomföras under söndagen eller måndagen. Polisen är intresserad av iakttagelser i det aktuella området runt 3-tiden i natt. Den som befunnit sig i området, eller har andra upplysningar som kan vara av intresse, uppmanas att ringa 114 14.</p>\n<p><strong>04.08 Misshandel, Linköping</strong><br /> Polis larmades till Vasastaden, Linköping, där två män i 25-årsåldern blivit misshandlade/slagna med ett tillhygge. Kort efter att polis kom till platsen träffade man på en man som stämde väl in på signalementet som vittnen gett. Han greps, misstänkt för misshandel. De bägge målsäganden behövde inte sjukvård efter händelsen. Den gripne är en man i 60-årsåldern. Gripandet hävdes vid 06.40 på söndagsmorgonen.</p>",
