    "content": "<p>Klockan 00-07:30, det har varit en natt med normal arbetsbelastning. Sex personer har omhändertagits för fylleri och två personer har medtagits för provtagning efter misstanke om narkotikabrott. Polisen har även utfört ett flertal kontroller av personer och fordon som inte resulterat i någon brottsmisstanke.</p>\n<p>Här följer ett urval av nattens händelser:</p>\n<p><strong>00:18 Skadegörelse, Nordmaling</strong><br />Polis åkte till en by i Nordmalings kommun med anledning av en stökig fest i en samlingslokal. Stolar och bord var sönderslagna och en anmälan gällande skadegörelse upprättas. Polisen är kvar på platsen till strax efter klockan två.</p>\n<p><strong>02:30 Misshandel, Skellefteå</strong><br />En patrull åkte till en hotellreception i Skellefteå med anledning av en misshandel. En person, en man, som har blivit misshandlad var kvar på platsen. Patrullen skjutsar honom till sjukvård och en anmälan gällande misshandel upprättas. Ingen misstänkt gärningsperson påträffas.</p>\n<p><strong>03:09 Misshandel, Skellefteå</strong><br />Polis beordrades till en plats på Södra Järnvägsgatan i Skellefteå med anledning av en misshandel. En man hade blivit misshandlad av en annan man, båda är i 20-årsåldern. En patrull skjutsade den misshandlade till sjukvård. Mannen som misstänks för misshandeln omhändertogs med stöd av lagen om omhändertagande av berusade personer (LOB). Patrullen höll förhör och en anmälan gällande misshandel upprättas.</p>\n<p><strong>05:33 Stöld/inbrott, Skellefteå</strong><br />En patrull beordrades till Byske med anledning av att två restauranger eventuellt hade utsatts för inbrott. Enligt initiala uppgifter ska två fönster varit trasiga. Inga misstänkta personer var kvar på platsen när patrullen anlände. Patrullen utförde en brottsplatsundersökning och en anmälan gällande stöld genom inbrott upprättas.</p>",
    "content_formatted": "<p><p>Klockan 00-07:30, det har varit en natt med normal arbetsbelastning. Sex personer har omhändertagits för fylleri och två personer har medtagits för provtagning efter misstanke om narkotikabrott. Polisen har även utfört ett flertal kontroller av personer och fordon som inte resulterat i någon brottsmisstanke.</p></p><p><p>Här följer ett urval av nattens händelser:</p></p><p><p><strong>00:18 Skadegörelse, Nordmaling</strong><br />Polis åkte till en by i Nordmalings kommun med anledning av en stökig fest i en samlingslokal. Stolar och bord var sönderslagna och en anmälan gällande skadegörelse upprättas. Polisen är kvar på platsen till strax efter klockan två.</p></p><p><p><strong>02:30 Misshandel, Skellefteå</strong><br />En patrull åkte till en hotellreception i Skellefteå med anledning av en misshandel. En person, en man, som har blivit misshandlad var kvar på platsen. Patrullen skjutsar honom till sjukvård och en anmälan gällande misshandel upprättas. Ingen misstänkt gärningsperson påträffas.</p></p><p><p><strong>03:09 Misshandel, Skellefteå</strong><br />Polis beordrades till en plats på Södra Järnvägsgatan i Skellefteå med anledning av en misshandel. En man hade blivit misshandlad av en annan man, båda är i 20-årsåldern. En patrull skjutsade den misshandlade till sjukvård. Mannen som misstänks för misshandeln omhändertogs med stöd av lagen om omhändertagande av berusade personer (LOB). Patrullen höll förhör och en anmälan gällande misshandel upprättas.</p></p><p><p><strong>05:33 Stöld/inbrott, Skellefteå</strong><br />En patrull beordrades till Byske med anledning av att två restauranger eventuellt hade utsatts för inbrott. Enligt initiala uppgifter ska två fönster varit trasiga. Inga misstänkta personer var kvar på platsen när patrullen anlände. Patrullen utförde en brottsplatsundersökning och en anmälan gällande stöld genom inbrott upprättas.</p></p>",
