    "content": "<p>Vid 22-tiden hör vittnen skottlossning i kvarteret kring Författargatan, Vivalla, i Örebro. Vittnen iakttar också person med något som uppfattas som ett vapen. Polisen vill komma i kontakt med vittnen som har upplysningar i ärendet. Upplysningar kan lämnas på telefon 114 14.</p>",
