    "description": "Ett urval ur händelserna i länet under kvällen/natten. Presstalesperson under helgen är Stefan Gustafsson.",
    "content": "<p><strong>Kl 00.00 Göteborg, överfallsvåldtäkt mot barn<br /></strong>En mamma kontaktar polisen efter det att hon fått veta av sin dotter som är under 15 år att dottern ska ha blivit våldtagen. Flickan har uppgivit för mamman att hon mellan kl 22.30-23.30 passerat området kring en tunnel som finns vid Mejramsgatan. En för flickan okänd yngre man ska då ha då släpat upp henne i ett närbeläget skogsområde och där fullbordat våldtäkten. Flickan har vissa skador som hon uppger uppkommit vid brottstillfället.  <strong><br /></strong>Polis åker till platsen och får brottsplatsen utpekad, den spärras av och polisen söker efter spår med hund. Flickan förs till sjukhus för läkarundersökning. Anmälan upprättas med rubricering våldtäkt mot barn.</p>\n<p>Avspärrningarna har hävts. Brottsplatsundersökning genomförd. Ingen gripen.  </p>\n<p><strong>Polisen söker vittnen eller andra uppgifter kring händelsen som kan leda fram till att gärningsmannen kan gripas. Har någon sett något eller har annan kunskap kring händelsen, kontakta polisen på 114 14.</strong></p>\n<p><strong>Kl 00.07 Tidaholm, grovt hot mot tjänsteman mm</strong><br />En polispatrull larmas till en bensinstation vid Nya torget efter det att en väktare tryckt på sitt larm. När polisen kommer fram möts de omedelbart av en man med kniv i handen som går mot poliserna. Poliserna väljer då att skjuta varningsskott. Mannen släpper då kniven och kan gripas men han fortsätter med att bete sig mycket hotfullt mm.</p>\n<p>Det visar sig att anställda på bensinstationen låst dörren till butiken efter det att mannen dykt upp med kniv i handen. Mannen uppger själv att han kommit till platsen för att råna stället. Den gripne förs till Skövde. Den gripne misstänks för förberedelse till rån, grovt hot mot tjänsteman och brott mot knivlagen. Mannen anhölls av åklagare efter förhör.</p>\n<p>Ingen av de inblandade skadas fysiskt i samband med händelsen.</p>\n<p><strong>Kl 00.10 Göteborg, bråk</strong><br />Polis larmas till hållplatsen vid Askims stationsväg. Enligt uppgift från platsen så ska ca 20 ungdomar bråka på platsen. Det är dock bara ett fåtal av dessa som slåss. Även ambulans larmas till platsen. När polispatrullerna kommer fram så springer folk åt alla håll. Polisen finner tre personer som uppger att de blivit slagna. Polis söker i omgivningarna efter de som lämnat platsen, även med hund. Polisen får in ett flertal vittnesmål hur man sett lämna platsen till fots. <br />De tre som uppges ha blivit misshandlade har relativt lindriga skador.Tre personer hittas av polisen som båda pekas ut som gärningsmän. Dessa tre delges misstanke om misshandel och i ett fall brott mot knivlagen. Därefter körs de hem till föräldrarna. Samtliga är ungdomar och troligen har hela sällskapet varit på en fest där bråket inleds, anledningen är inte känd för polisen. Ingen av de skadade förs till sjukhus.      </p>",
    "content_formatted": "<p><p><strong>Kl 00.00 Göteborg, överfallsvåldtäkt mot barn<br /></strong>En mamma kontaktar polisen efter det att hon fått veta av sin dotter som är under 15 år att dottern ska ha blivit våldtagen. Flickan har uppgivit för mamman att hon mellan kl 22.30-23.30 passerat området kring en tunnel som finns vid Mejramsgatan. En för flickan okänd yngre man ska då ha då släpat upp henne i ett närbeläget skogsområde och där fullbordat våldtäkten. Flickan har vissa skador som hon uppger uppkommit vid brottstillfället.  <strong><br /></strong>Polis åker till platsen och får brottsplatsen utpekad, den spärras av och polisen söker efter spår med hund. Flickan förs till sjukhus för läkarundersökning. Anmälan upprättas med rubricering våldtäkt mot barn.</p></p><p><p>Avspärrningarna har hävts. Brottsplatsundersökning genomförd. Ingen gripen.  </p></p><p><p><strong>Polisen söker vittnen eller andra uppgifter kring händelsen som kan leda fram till att gärningsmannen kan gripas. Har någon sett något eller har annan kunskap kring händelsen, kontakta polisen på 114 14.</strong></p></p><p><p><strong>Kl 00.07 Tidaholm, grovt hot mot tjänsteman mm</strong><br />En polispatrull larmas till en bensinstation vid Nya torget efter det att en väktare tryckt på sitt larm. När polisen kommer fram möts de omedelbart av en man med kniv i handen som går mot poliserna. Poliserna väljer då att skjuta varningsskott. Mannen släpper då kniven och kan gripas men han fortsätter med att bete sig mycket hotfullt mm.</p></p><p><p>Det visar sig att anställda på bensinstationen låst dörren till butiken efter det att mannen dykt upp med kniv i handen. Mannen uppger själv att han kommit till platsen för att råna stället. Den gripne förs till Skövde. Den gripne misstänks för förberedelse till rån, grovt hot mot tjänsteman och brott mot knivlagen. Mannen anhölls av åklagare efter förhör.</p></p><p><p>Ingen av de inblandade skadas fysiskt i samband med händelsen.</p></p><p><p><strong>Kl 00.10 Göteborg, bråk</strong><br />Polis larmas till hållplatsen vid Askims stationsväg. Enligt uppgift från platsen så ska ca 20 ungdomar bråka på platsen. Det är dock bara ett fåtal av dessa som slåss. Även ambulans larmas till platsen. När polispatrullerna kommer fram så springer folk åt alla håll. Polisen finner tre personer som uppger att de blivit slagna. Polis söker i omgivningarna efter de som lämnat platsen, även med hund. Polisen får in ett flertal vittnesmål hur man sett lämna platsen till fots. <br />De tre som uppges ha blivit misshandlade har relativt lindriga skador.Tre personer hittas av polisen som båda pekas ut som gärningsmän. Dessa tre delges misstanke om misshandel och i ett fall brott mot knivlagen. Därefter körs de hem till föräldrarna. Samtliga är ungdomar och troligen har hela sällskapet varit på en fest där bråket inleds, anledningen är inte känd för polisen. Ingen av de skadade förs till sjukhus.      </p></p>",
