    "description": "Brand i flerfamiljshus, Bålsta",
    "content": "<p>Kl 03.00 inom larm om brand i flerfamiljshus på Bålstavägen i Bålsta. Branden skall ha varit fullt utvecklad med spridning upp på taket i samband med att räddningsresurser anlände.</p>\n<p>Polisen har varit räddningstjänsten behjälplig med utrymning av fastigheten, sammanlagt ca 25 personer. Inga personer skall ha skadats i samband med branden.</p>\n<p>Biografen Borgen har öppnats upp och används som samlingslokal för de boende som inte kunnat ta sig hem till vänner/bekanta.</p>\n<p>Polisen har även vidttagit diverse utredningsåtgärder på platsen för att försöka utröna vad som kan ha orsakat branden. I nuläget finns inga uppgifter som tyder på att branden skulle varit anlagd. En förundersökning gällande mordbrand är inledd i syfte att kunna utreda brandorsaken.</p>\n<p>Insatsen fortgår.</p>\n<p>UPPDATERING KL. 06.08</p>\n<p>Efter utredningsåtgärder på plats har man rubricerat om ärendet till grov allmänfarlig vårdslöshet. Den operativa insatsen är avslutad. Platsen är avspärrad i avvaktan på teknisk undersökning. Eftersläckning på brandplatsen fortgår.<br /><br /><strong>Uppdatering kl 09:02<br /><br /></strong>Vid branden evakuerades både det brinnande flerbostadshuset och ett grannhus. De boende i grannhuset har fått återvända till sina lägenheter. <br />Det brunna huset består av åtta lägenheter fördelade på två plan. De boende på nedre botten har fått möjlighet att tillfälligt hämta olika tillhörigheter i sina bostäder, men har alltså inte kunnat återvända permanent.<br />De boende i de fyra lägenheterna på plan 2 har inte kunnat besöka sina bostäder alls.<br />Taket och vinden är kraftigt skadat av branden och arbete pågår bland annat med kranbilar för att komma åt eventuella mindre härdar i stukturen.<br />Polisen har bevakning på plats.</p>",
    "content_formatted": "<p><p>Kl 03.00 inom larm om brand i flerfamiljshus på Bålstavägen i Bålsta. Branden skall ha varit fullt utvecklad med spridning upp på taket i samband med att räddningsresurser anlände.</p></p><p><p>Polisen har varit räddningstjänsten behjälplig med utrymning av fastigheten, sammanlagt ca 25 personer. Inga personer skall ha skadats i samband med branden.</p></p><p><p>Biografen Borgen har öppnats upp och används som samlingslokal för de boende som inte kunnat ta sig hem till vänner/bekanta.</p></p><p><p>Polisen har även vidttagit diverse utredningsåtgärder på platsen för att försöka utröna vad som kan ha orsakat branden. I nuläget finns inga uppgifter som tyder på att branden skulle varit anlagd. En förundersökning gällande mordbrand är inledd i syfte att kunna utreda brandorsaken.</p></p><p><p>Insatsen fortgår.</p></p><p><p>UPPDATERING KL. 06.08</p></p><p><p>Efter utredningsåtgärder på plats har man rubricerat om ärendet till grov allmänfarlig vårdslöshet. Den operativa insatsen är avslutad. Platsen är avspärrad i avvaktan på teknisk undersökning. Eftersläckning på brandplatsen fortgår.<br /><br /><strong>Uppdatering kl 09:02<br /><br /></strong>Vid branden evakuerades både det brinnande flerbostadshuset och ett grannhus. De boende i grannhuset har fått återvända till sina lägenheter. <br />Det brunna huset består av åtta lägenheter fördelade på två plan. De boende på nedre botten har fått möjlighet att tillfälligt hämta olika tillhörigheter i sina bostäder, men har alltså inte kunnat återvända permanent.<br />De boende i de fyra lägenheterna på plan 2 har inte kunnat besöka sina bostäder alls.<br />Taket och vinden är kraftigt skadat av branden och arbete pågår bland annat med kranbilar för att komma åt eventuella mindre härdar i stukturen.<br />Polisen har bevakning på plats.</p></p>",
    "content_teaser": "Kl 03.00 inom larm om brand i flerfamiljshus på Bålstavägen i Bålsta. Branden skall ha varit fullt utvecklad med spridning upp på taket i samband med att räddni...",
