    "description": "Ett urval från Västernorrland/ Kramfors",
    "content": "<p>Stökigt i Kramfors under kvällen natten.</p>\n<p>En restaurang hade Western-tema och nog gick det vilt till. Fyra gånger var polisen där för att ta med sig personer som vakterna hade omhändertagit. En person misstänks för brott mot knivlagen samt ringa narkotikabrott. En anmälan om misshandel skrevs.</p>\n<p>Ute på samhället var det lite av samma tema.  Vid 02.30 blev två  personer misshandlade av flera gärningsmän. Båda personerna blev enligt anmälan slagna i huvudtrakten med ett tillhygge. Mycket tyder på att det är två grupper av ungdomar som bråkat.</p>\n<p>En skadad  fördes med ambulans till Sollefteå.<br />En skadad fördes till Örnsköldsvik sjukhus. Bägge ska ha sårskador i ansikte/ huvud.<br />Poliser på plats utreder vad som har hänt och skriver anmälan. Ingen person är i nuläget gripen.</p>\n<p>Uppdatering, sammanfattning 07:04 (av Elisabeth Glaas, RLC-kommunikatör)<br />Det har varit en natt med normal arbetsbelastning. Två personer har omhändertagits för fylleri och en person har medtagits för provtagning efter misstanke om narkotikabrott. Polisen har även utfört ett flertal kontroller av personer och fordon som inte resulterat i någon brottsmisstanke.</p>",
