    "description": "Den senaste tiden har äldre personer utsatts för bedrägerier av falska poliser. Tala gärna med dina äldre anhöriga om detta. Läs mer här:",
    "content": "<p>Det kan gå till på olika sätt. Till exempel att någon ringer upp och säger sig arbeta för Polismyndigheten och behöver tillgång till bankkort, pin-kod och värdesaker. Vid ett par tillfällen har sedan någon dykt up för att hämta sakerna.</p>\n<p>Men bedragarna kan också ange andra orsaker till att de vill komma in i din bostad eller ha dina bankkoder mm. Uppfinnigsrikedomen och hänsynslösheten är tyvärr stor.</p>\n<p>Lämna aldrig ut pin-kod eller dylikt till en okänd - var sunt misstänksam och ifrågasätt.</p>\n<p>Lämna aldrig över legtimation, bankkort eller ge koder till någon annan person.</p>\n<p>Om du misstänker att du utsätts för brott - ring 112. Om brottet inte är pågående ska du ringa 114 14.</p>",
