    "description": "Polis söker efter försvunnen kvinna, V. Ingelstad.",
    "content": "<p>Flera polispatruller söker nu efter en 74-årig kvinna som försvunnit från ett boende på Stationsvägen i Västra Ingelstad. Kvinnan tros ha lämnat boendet till fots vid 18-tiden. Med hänsyn till kvinnans hälsostatus är det angeläget att hon anträffas snarast. Polis utesluter inte att kvinnan kan ha gått ombord på tåg eller buss och därför kan befinna sig på annan ort.</p>\n<p><strong>Signalement:</strong></p>\n<p>Kvinnan är 165 cm lång, normalbygd och går lätt framåtlutad. Hon är klädd i blå jeans, svarta kängor, svart väst, rosa ulltröja, svarta vantar, glasögon, ingen mössa, grått hår i page.</p>\n<p>Ser du eller har du nyss sett kvinnan? Ring i så fall 112.</p>\n<p><strong>Uppdatering:</strong> Kvinnan är anträffad och hon mår efter omständigheterna bra. Polisen tackar för alla tips och engagemang från allmänheten!</p>\n",
