    "content": "<p>Två trafikolyckor har inträffat i närheten av varandra på E4 mellan Ljungby och Traryd, strax söder om Hamneda. Den första olyckan omfattar en personbil med två barn och en vuxen i, samtliga är oskadda. Den andra olyckan gäller två personbilar, oklart antal personer. Ambulans är på plats vid den andra olyckan och kontrollerar de drabbade. Polis är på väg till olycksplatserna.</p>\n<p>Enligt personal på plats är det mycket halt på vägen.</p>\n<p><strong>Uppdatering:</strong> En bil kommer att behöva bärgas. Det är begränsad framkomlighet i södergående riktning. Arbetet på platsen väntas vara klart vid 20.00.</p>",
