    "description": "På E4, i höjd med Bredsand, har en trafikolycka inträffat.",
    "content": "<p>Enligt initiala uppgifter har en bilförare, en man i 30-årsåldern, kört in i baksidan på en ATK-vagn med en personbil. ATK-vagnen, som är en mobil trafiksäkerhetskamera, var påkopplad på en polisbil.</p>\n<p>Mannen förs till sjukhus med ambulans. Det finns inga uppgifter om eventuella skador.</p>\n<p>Olyckan påverkar trafiken.</p>\n<p>Uppdatering 10:59<br />Den misstänkte är gripen misstänkt för grov vårdslöshet i trafik, grovt rattfylleri samt grov olovlig körning. <br />Han är även misstänkt för tre fall av vållande till kroppsskador. Två av de berörda personerna är poliser och den tredje färdades med den misstänkte i personbilen.<br />Totalt fyra personer har förts till sjukhus med oklara skador. Den misstänkte mannens bil är tagen i beslag. Jourhavande förundersökningsledare leder ärendet i nuläget.</p>",
    "content_formatted": "<p><p>Enligt initiala uppgifter har en bilförare, en man i 30-årsåldern, kört in i baksidan på en ATK-vagn med en personbil. ATK-vagnen, som är en mobil trafiksäkerhetskamera, var påkopplad på en polisbil.</p></p><p><p>Mannen förs till sjukhus med ambulans. Det finns inga uppgifter om eventuella skador.</p></p><p><p>Olyckan påverkar trafiken.</p></p><p><p>Uppdatering 10:59<br />Den misstänkte är gripen misstänkt för grov vårdslöshet i trafik, grovt rattfylleri samt grov olovlig körning. <br />Han är även misstänkt för tre fall av vållande till kroppsskador. Två av de berörda personerna är poliser och den tredje färdades med den misstänkte i personbilen.<br />Totalt fyra personer har förts till sjukhus med oklara skador. Den misstänkte mannens bil är tagen i beslag. Jourhavande förundersökningsledare leder ärendet i nuläget.</p></p>",
