    "content": "<p>00-07.30, det har varit en natt med normal arbetsbelastning. En person har omhändertagits för fylleri. Polisen har även utfört ett flertal kontroller av personer och fordon som inte resulterat i någon brottsmisstanke. </p>\n<p>Här följer ett urval av nattens händelser:</p>\n<p><strong>01:51 Narkotikabrott, Östersund</strong><br />En patrull kontrollerade en person, som är en man i 20-årsåldern, på en krog i Östersund. Mannen bar på misstänkt narkotika. Patrullen höll förhör och tog den misstänkta narkotikan i beslag. En anmälan gällande misstänkt narkotikabrott i överlåtelsesyfte upprättas.</p>\n<p>Tre viltolyckor har anmälts till polisen under natten och morgonen. Ingen person skadades i samband med olyckorna.</p>",
