    "content": "<p>Polisen i Jönköpings län har under natten hanterat ett 70-tal händelser. En person har gripits, åtta personer har omhändertagits för fylleri eller andra ordningsstörningar.</p>\n<p><strong>03.27 Skadegörelse, Gränna</strong><br /> Polis larmades till en pågående skadegörelse på Hamnvägen i Gränna. En man skulle ha slagit sönder flertalet rutor på en fastighet med ett tillhygge. Han ska även ha tagit sig in i en tvättstuga på innergården och slagit sönder den. När polis kom till platsen kunde mannen gripas under odramatiska former. Han anhölls inte av åklagare och därför hävdes gripandet vid 06.40 på lördagsmorgonen. Mannen, som är i 35-årsåldern, är misstänkt för skadegörelse. Ingen person kom till skada i samband med händelsen.</p>\n<p><strong>03.38 Bråk, Jönköping</strong><br /> Polis larmades till en bostad i Liljeholmen, Jönköping, efter samtal om bråk i bostaden. När polis kom till platsen fann man ett flertal mycket berusade personer i bostaden. Ingen misshandel hade skett, utan mer verbalt tjafs under påverkan av alkohol. En person omhändertogs enligt PL13.</p>\n<p><strong>06.46 Trafikolycka, Jönköping</strong><br /> Singelolycka på Barnarpsgatan i Jönköping där en personbil av okänd anledning kört in i en vägskylt i rondellen vid högskolan. Föraren oskadd, ringde själv SOS och larmade om olyckan. Bilen behöver bärgas. Föraren uppgav själv att han somnat vid ratten och en förundersökning om vårdslöshet i trafik har därför inletts.</p>",
