    "content": "<p>Polisen i Östergötlands län har under natten hanterat ett 90-tal händelser. En person har gripits och 14 personer har omhändertagits för fylleri eller andra ordningsstörningar.</p>\n<p><strong>23.30 Misshandel, Mjölby</strong><br /> Polis fick samtal om att det pågick ett bråk i en bostad i Mjölby kommun. När polis kom till platsen hade läget lugnat ner sig, en man i 50-årsåldern greps misstänkt för misshandel i relation, olaga hot, hot mot tjänsteman samt våldsamt motstånd. Målsägande är en kvinna i 35-årsåldern. Polisen har inga uppgifter om att någon ska ha behövt sjukvård i samband med händelsen.</p>\n<p><strong>03.52 Stöld/inbrott, Mjölby</strong><br /> Polis fick samtal om ett pågående inbrott i en kontorslokal i centrala Mjölby. Inringare ska ha sett en man slå sönder en ruta och dragit ut misstänkt stöldgods genom fönstret. Ingen kvar på platsen när polis kom dit, vissa spår kunde dock säkras och en anmälan om stöld genom inbrott har upprättats. Det är i skrivande stund oklart vad gärningspersonen fick med sig.</p>\n<p><strong>06.52 Brand, Motala</strong><br /> Larm om röklukt i ett trapphus på Agneshögsgatan i Motala. Räddningstjänsten fick snabbt kontroll på situationen, det visade sig vara lakan som brunnit på en balkong, det bedömdes inte ha funnits någon spridningsrisk. Polis lämnade platsen utan åtgärd.</p>",
    "content_formatted": "<p><p>Polisen i Östergötlands län har under natten hanterat ett 90-tal händelser. En person har gripits och 14 personer har omhändertagits för fylleri eller andra ordningsstörningar.</p></p><p><p><strong>23.30 Misshandel, Mjölby</strong><br /> Polis fick samtal om att det pågick ett bråk i en bostad i Mjölby kommun. När polis kom till platsen hade läget lugnat ner sig, en man i 50-årsåldern greps misstänkt för misshandel i relation, olaga hot, hot mot tjänsteman samt våldsamt motstånd. Målsägande är en kvinna i 35-årsåldern. Polisen har inga uppgifter om att någon ska ha behövt sjukvård i samband med händelsen.</p></p><p><p><strong>03.52 Stöld/inbrott, Mjölby</strong><br /> Polis fick samtal om ett pågående inbrott i en kontorslokal i centrala Mjölby. Inringare ska ha sett en man slå sönder en ruta och dragit ut misstänkt stöldgods genom fönstret. Ingen kvar på platsen när polis kom dit, vissa spår kunde dock säkras och en anmälan om stöld genom inbrott har upprättats. Det är i skrivande stund oklart vad gärningspersonen fick med sig.</p></p><p><p><strong>06.52 Brand, Motala</strong><br /> Larm om röklukt i ett trapphus på Agneshögsgatan i Motala. Räddningstjänsten fick snabbt kontroll på situationen, det visade sig vara lakan som brunnit på en balkong, det bedömdes inte ha funnits någon spridningsrisk. Polis lämnade platsen utan åtgärd.</p></p>",
