    "content": "<p>Polisen i Södermanlands län har hanterat ett 80-tal händelser sedan klockan 22 i går kväll. Ingen person har gripits, åtta personer har omhändertagits för fylleri eller andra ordningsstörningar.</p>\n<p><strong>02.27 Brand, Gnesta</strong><br /> Larm om brand i ett soprum i ett flerfamiljshus i centrala Gnesta. Det ska ha brunnit i två stycken sopkärl och varit en fullt utvecklad brand, som räddningstjänsten lyckades släcka. En anmälan om skadegörelse genom brand kommer att upprättas.</p>\n<p><strong>05.08 Trafikolycka, Nyköping</strong><br /> Larm om en bil som kört ner i ett dike i Stavsjö, Nyköping. En inringare hade sett hur bilisten kört fast i leran och därefter försökt använda en brevlåda för att försöka komma loss – utan större framgång. Föraren försvann därefter från platsen, men återkom strax därefter när polis anlände. Mannen var berusad och omhändertogs enligt Lob. Bilnycklarna omhändertogs, men då det inte gick att styrka körning slutade det inte med någon anmälan.</p>",
