    "description": "Ett urval ur kvällen/nattens händelser i länet. Presstalesperson under helgen är Stefan Gustafsson.",
    "content": "<p><strong>Kl 01.24 Nödinge, grovt rån</strong><br />Ett antal personer som befinner sig i en lägenhet vid Södra Klöverstigen uppger att en grupp okända personer som varit maskerade ska ha trängt sig in i bostaden. De ska ha hotat och slagit de personer som befann sig i lägenheten. Möjligen tagit någon telefon. När gruppen av gärningsmän lämnat platsen så larmas polis. Polis åker till platsen och genomför utredningsåtgärder. Förundersökning angående grovt rån inleds. Inga kända personskador. Ingen gripen. Väldigt oklara omständigheter.</p>\n<p><strong>Kl 01.29 Lidköping, grov misshandel</strong><br />Polis och ambulans larmas till Förstadsvägen/Läckögatan där en man uppges blivit knivskuren. När polis kommer fram så finner man en man som har skador, troligen från kniv. Skador sitter i nedre delen av baksidan bålen. Mannen har även någon huvudskada. Han har svårt för att redogöra för vad som hänt. Den skadade körs till sjukhus med hjälp av ambulans. Anmälan om grov misshandel upprättas. Ingen gripen i nuläget.</p>\n<p><strong>Kl 05.25 Göteborg, grov misshandel</strong><br />Polis larmas till en grillrestaurang vid Vasagatan efter det att någon sett en man med  skador som man tror är knivskador. Mannen ska blöda från området kring magen. Uppgifterna kommer från vittnen på plats. När polisen kommer fram så har den skadade lämnat i taxi, troligen mot Sahlgrenska sjukhuset. Polisen följer efter. Den skadade anträffas på sjukhuset. Han har ett antal stickskador i bröstet men ingen livshotande. Oklart vad som inträffat. Anmälan om grov misshandel upprättas. Ingen gripen.  </p>\n\n",
