    "description": "Ett urval av nattens polisverksamhet.",
    "content": "<p>Klockan 00-07.30, det har varit en natt med normal arbetsbelastning. Två personer har omhändertagits för fylleri. Polisen har även utfört ett flertal kontroller av personer och fordon som inte resulterat i någon brottsmisstanke.</p>\n<p>Här följer ett urval av nattens händelser:</p>\n<p><strong>00:01 Rattfylleri, Lycksele</strong><br />En patrull stoppade och kontrollerade en personbil i centrala Lycksele. Misstanke uppstod om att föraren, en man i 20-årsåldern, var påverkad av narkotika. Han togs med för provtagning. En anmälan gällande misstänkt drograttfylleri upprättas.</p>\n<p><strong>00:49 Rattfylleri, Skellefteå</strong><br />En patrull stoppade och kontrollerade en personbil i centrala Skellefteå. Föraren, en man i 30-årsåldern, misstänktes för rattfylleri. Han blåser positivt i sållningsinstrumentet och togs med för provtagning. En anmälan gällande misstänkt rattfylleri upprättas.</p>\n<p><strong>02:15 Stöld, Umeå</strong><br />Polis beordrades till järnvägsstationen i Umeå med anledning av att en ordningsvakt hade envarsgripit en person som misstänktes för stöld. Personen, en man i 35-årsåldern, misstänktes ha stulit föremål från resenärer på Stockholmståget. Mannen anhölls senare av åklagare. Det kan finns flera målsäganden i ärendet, om så är fallet vill polisen komma i kontakt med dem. De uppmanas ringa 114 14.</p>\n<p>En viltolycka har anmälts till polisen under natten och morgonen. Ingen person skadades i samband med olyckan.</p>",
    "content_formatted": "<p><p>Klockan 00-07.30, det har varit en natt med normal arbetsbelastning. Två personer har omhändertagits för fylleri. Polisen har även utfört ett flertal kontroller av personer och fordon som inte resulterat i någon brottsmisstanke.</p></p><p><p>Här följer ett urval av nattens händelser:</p></p><p><p><strong>00:01 Rattfylleri, Lycksele</strong><br />En patrull stoppade och kontrollerade en personbil i centrala Lycksele. Misstanke uppstod om att föraren, en man i 20-årsåldern, var påverkad av narkotika. Han togs med för provtagning. En anmälan gällande misstänkt drograttfylleri upprättas.</p></p><p><p><strong>00:49 Rattfylleri, Skellefteå</strong><br />En patrull stoppade och kontrollerade en personbil i centrala Skellefteå. Föraren, en man i 30-årsåldern, misstänktes för rattfylleri. Han blåser positivt i sållningsinstrumentet och togs med för provtagning. En anmälan gällande misstänkt rattfylleri upprättas.</p></p><p><p><strong>02:15 Stöld, Umeå</strong><br />Polis beordrades till järnvägsstationen i Umeå med anledning av att en ordningsvakt hade envarsgripit en person som misstänktes för stöld. Personen, en man i 35-årsåldern, misstänktes ha stulit föremål från resenärer på Stockholmståget. Mannen anhölls senare av åklagare. Det kan finns flera målsäganden i ärendet, om så är fallet vill polisen komma i kontakt med dem. De uppmanas ringa 114 14.</p></p><p><p>En viltolycka har anmälts till polisen under natten och morgonen. Ingen person skadades i samband med olyckan.</p></p>",
