    "content": "<p>En kvinna i 40-årsåldern ringer från Gärdet i Bollnäs och berättar att hon vaknat av att en främmande man är i hennes lägenhet. <br />När mannen kontrolleras visar det sig att han lämnat en fest hos en granne i samma trappuppång. När han skulle gå tillbaka till festen gick han in i fel lägenhet och somnade i soffan. <br />Kvinnan vill inte göra någon anmälan och mannen skjutsas hem av polis.</p>",
