    "description": "Ett urval av nattens polisverksamhet.",
    "content": "<p>Klockan 00-07, det har varit en natt med normal arbetsbelastning. Tre personer har omhändertagits för fylleri. Polisen har även utfört ett flertal kontroller av personer och fordon som inte resulterat i någon brottsmisstanke.</p>\n<p>Här följer ett urval av nattens händelser:</p>\n<p><strong>01:01 Trafikbrott, Boden</strong><br />En patrull stoppade och kontrollerade en personbil i Boden. Då det rådde körförbud för aktuellt fordon utfärdades en ordningsbot (böter). </p>\n<p><strong>02:42 Misshandel, Piteå</strong><br />Polis åkte till en adress i Piteå med anledning av en misshandel. En man misstänktes ha misshandlat en annan man, de känner varandra och är båda i 40-årsåldern. Polis höll förhör och en anmälan gällande misstänkt misshandel och olaga hot upprättas.</p>\n<p>Två viltolyckor har anmälts till polisen under natten och morgonen. Ingen person skadades i samband med olyckorna.</p>",
