    "title_location": "Uppsala",
    "description": "Man knivhuggen i magen, Uppsala",
    "content": "<p>Vid 02.54-tiden larmades polis till en adressen i Sunnersta då en man uppgav sig blivit knivhuggen i magen. Händelsen skall ha utspelat sig i centrala Uppsala ca 1,5-2 timmar tidigare. Den skadade mannen hade själv kunnat ta sig hem till sin bostad varefter han larmade polis. Mannen skall även fått en flaska slagen i huvudet.</p>\n<p>Mannen skall inte vara livshotade skadad och avtransporterades till sjukhus av ambulans.</p>\n<p>Polisen har upprättat en anmälan gällande grov misshandel samt utreder eventuella samband med den misshandel som inträffade i korsningen S:t Olofsgatan/Väderkvarnsgatan tidigare under natten.</p>\n",
    "content_formatted": "<p><p>Vid 02.54-tiden larmades polis till en adressen i Sunnersta då en man uppgav sig blivit knivhuggen i magen. Händelsen skall ha utspelat sig i centrala Uppsala ca 1,5-2 timmar tidigare. Den skadade mannen hade själv kunnat ta sig hem till sin bostad varefter han larmade polis. Mannen skall även fått en flaska slagen i huvudet.</p></p><p><p>Mannen skall inte vara livshotade skadad och avtransporterades till sjukhus av ambulans.</p></p><p><p>Polisen har upprättat en anmälan gällande grov misshandel samt utreder eventuella samband med den misshandel som inträffade i korsningen S:t Olofsgatan/Väderkvarnsgatan tidigare under natten.</p></p><p></p>",
