    "content": "<p>Sundsvall Birsta  23.40</p>\n<p>Larm om att flera personer slåss utanför MC Donalds.  Ett flertal polispatruller åker till platsen och tvingas avvisa flera personer från platsen. En person förs till sjukhus med ambulans med vad som ska vara mindre blessyrer. Två  anmälningar  misshandel skrivs av polis på plats.</p>\n<p>Örnsköldsvik  21 tiden</p>\n<p>Larm från busschaufför om bråk på bussen.  En ung passagerare (15 års åldern)  misstänks för våld mot busschauffören som efter visst tumult lyckades övermanna den unge och hålla fast honom till polis kom till plasten.</p>\n<p>Polisen höll förhör på plats. Sedan togs den misstänkte unge mannen med till polisstationen för kroppsbesiktning och förhör.  Han misstänks för Våld och hot mot tjänsteman samt ringa narkotikabrott eget bruk.</p>",
