    "description": "En bostad på Kjellmansgatan skall brinna.",
    "content": "<p>Räddningstjänst, ambulans samt polis till platsen då det kommer svart rök från taken på Kjellmansgatan i Masthugget. Skall brinna i ett kök inne i fastigheten, oklar omfattning i nuläget.</p>\n<p>En person har hoppat från andra våningen och har omhändertagits av ambulanspersonal. Personen vaken och talbar men klagar över ryggsmärtor efter hoppet.</p>\n<p>Enligt räddningstjänsten så har man släckt branden samt att det inte rådde någon spridningsrisk.</p>\n<p>Platsen avspärrad och en patrull tar sig till Sahlgrenska för att prata med den avförda personen.</p>\n<p><strong>Evakuering har gjorts och det rör sig om ca 20 personer totalt.</strong></p>\n<p><strong>En anmälan om allmänfarlig vårdslöshet har tagits upp. </strong></p>",
