    "title_type": "Sammanfattning vecka",
    "title_location": "Knivsta",
    "description": "POLISRUTAN - Ett urval av händelser i Knivsta från 15-21 feb samt tips på hur du skyddar dig mot vissa bedrägeribrott.",
    "content": "<p><strong>Sammanfattning av händelser i Knivsta från Lördag 15/2 – fredag 21/2</strong></p>\n<p><strong>Bedrägerivåg – så skyddar du dig</strong><br />Under den gångna veckan har polisen fått in flera tips om personer som ringt äldre människor och sagt att man kommer ifrån kommunen och vill kolla på ventilation/avlopp/sotning. Detta är <strong>inte </strong>kommunen som ringer vilket man kan läsa mer om på kommunens hemsida. Det har även förekommit att man uppger sig komma från Riksbanken.</p>\n<p>Här kommer några tips på hur du skyddar dig mot vissa typer av bedrägerier, genom länken sist i artikeln kan du läsa mer om ämnet:</p>\n<p><strong>Lämna aldrig ut</strong> koder eller andra känsliga uppgifter till någon. Någonsin. Kortuppgifter och koder är nycklar till dina pengar.<br />Använd aldrig din bankdosa eller bank-id på uppmaning av någon som kontaktar dig. Ingen seriös aktör skulle be dig om det per telefon.<br /><strong>Om någon du inte känner ringer och du blir osäker</strong>, lägg på luren eller be att få ringa tillbaka på ett nummer som du själv tar reda på. Det gäller oavsett om personen säger sig vara en nära släkting eller från banken, ett företag eller en myndighet <br /><strong>Ringer någon och uppger sig vara polis</strong>, motring genom att ringa 114 14 och be om att bli kopplad till aktuell person, alternativt verifiera angivet telefonnummer.<br /><strong>Lita inte på den som kontaktar dig</strong> bara för att den har personliga uppgifter om dig. Bedragare kan hitta information på nätet för att lura dig.<br /><strong>Om någon står utanför och vill komma in</strong> – väntar du inte besök så är huvudregeln att inte öppna dörren alls. I annat fall kontrollera först deras arbetslegitimation och jämför med personens körkort eller annan ID-handling genom titthåll/fönster/brevinkast. Ring även arbetsplatsen som dem säger sig komma ifrån för att verifiera. <br /><strong>Om någon säger sig vara polis som står utanför och vill komma in</strong> – kontrollera personens polislegitimation genom titthål eller liknande, samt ring polisens växel på 114 14 för att verifiera att det verkligen är en polis på plats. Är det en akut situation eller pågående brott ringer du alltid 112. <br /><strong>Om du drabbas av eller misstänker bedrägeri</strong>, kontakta din bank omgående. Polisanmäl alltid och ta stöd av människor i din närhet. För att polisanmäla så ringer du 114 14 (inget riktnummer). Vid akuta situationer eller pågående brottslighet ringer du 112.</p>\n<p><strong>Möte om Grannsamverkan (GSV)</strong><br />För att arbeta trygghetsskapande och förhindra inbrott så kan man gå med i grannsamverkan. Detta är ett koncept som verkligen gör skillnad. Är du intresserad av hur du kan skydda dig själv från bostadsinbrott så kom till polisens informationsmöte den 18.e mars i Knivsta kommunhus kl. 19.00.</p>\n<p><strong>15:e februari – 21 februari</strong></p>\n<p><strong>NÅGRA GENOMFÖRDA POLISINGRIPANDEN I KNIVSTA</strong> Antal<br />Trafikkontroller 2<br />Böter Trafikbrott Varav två omhändertagna körkort 6<br />Omhändertagna personer 1<br />Tips/Telefonsamtal Om brott m.m. från medborgare 24<br />Kontrollerade Personer/Fordon 33<br />Kontrollerad fest 1</p>\n<p><br /><strong>ETT URVAL AV HÄNDELSER OCH ANMÄLDA BROTT</strong> Antal<br />Olika former av bedrägerier via Tfn och Internet 4<br />Utpressning 3<br />Stöld ur bil 1<br />Viltolyckor 2</p>\n<p><strong>Anmäla brott eller tipsa polisen</strong> :<br />Ring 114 14 eller på bifogad länk kan du tipsa polisen, finns på Polisen.se :<br />https://polisen.se/kontakt/mejla-region-Mitt/<br /><strong>Pågående brott / färsk gärning: Ring 112</strong></p>\n",
    "content_formatted": "<p><p><strong>Sammanfattning av händelser i Knivsta från Lördag 15/2 – fredag 21/2</strong></p></p><p><p><strong>Bedrägerivåg – så skyddar du dig</strong><br />Under den gångna veckan har polisen fått in flera tips om personer som ringt äldre människor och sagt att man kommer ifrån kommunen och vill kolla på ventilation/avlopp/sotning. Detta är <strong>inte </strong>kommunen som ringer vilket man kan läsa mer om på kommunens hemsida. Det har även förekommit att man uppger sig komma från Riksbanken.</p></p><p><p>Här kommer några tips på hur du skyddar dig mot vissa typer av bedrägerier, genom länken sist i artikeln kan du läsa mer om ämnet:</p></p><p><p><strong>Lämna aldrig ut</strong> koder eller andra känsliga uppgifter till någon. Någonsin. Kortuppgifter och koder är nycklar till dina pengar.<br />Använd aldrig din bankdosa eller bank-id på uppmaning av någon som kontaktar dig. Ingen seriös aktör skulle be dig om det per telefon.<br /><strong>Om någon du inte känner ringer och du blir osäker</strong>, lägg på luren eller be att få ringa tillbaka på ett nummer som du själv tar reda på. Det gäller oavsett om personen säger sig vara en nära släkting eller från banken, ett företag eller en myndighet <br /><strong>Ringer någon och uppger sig vara polis</strong>, motring genom att ringa 114 14 och be om att bli kopplad till aktuell person, alternativt verifiera angivet telefonnummer.<br /><strong>Lita inte på den som kontaktar dig</strong> bara för att den har personliga uppgifter om dig. Bedragare kan hitta information på nätet för att lura dig.<br /><strong>Om någon står utanför och vill komma in</strong> – väntar du inte besök så är huvudregeln att inte öppna dörren alls. I annat fall kontrollera först deras arbetslegitimation och jämför med personens körkort eller annan ID-handling genom titthåll/fönster/brevinkast. Ring även arbetsplatsen som dem säger sig komma ifrån för att verifiera. <br /><strong>Om någon säger sig vara polis som står utanför och vill komma in</strong> – kontrollera personens polislegitimation genom titthål eller liknande, samt ring polisens växel på 114 14 för att verifiera att det verkligen är en polis på plats. Är det en akut situation eller pågående brott ringer du alltid 112. <br /><strong>Om du drabbas av eller misstänker bedrägeri</strong>, kontakta din bank omgående. Polisanmäl alltid och ta stöd av människor i din närhet. För att polisanmäla så ringer du 114 14 (inget riktnummer). Vid akuta situationer eller pågående brottslighet ringer du 112.</p></p><p><p><strong>Möte om Grannsamverkan (GSV)</strong><br />För att arbeta trygghetsskapande och förhindra inbrott så kan man gå med i grannsamverkan. Detta är ett koncept som verkligen gör skillnad. Är du intresserad av hur du kan skydda dig själv från bostadsinbrott så kom till polisens informationsmöte den 18.e mars i Knivsta kommunhus kl. 19.00.</p></p><p><p><strong>15:e februari – 21 februari</strong></p></p><p><p><strong>NÅGRA GENOMFÖRDA POLISINGRIPANDEN I KNIVSTA</strong> Antal<br />Trafikkontroller 2<br />Böter Trafikbrott Varav två omhändertagna körkort 6<br />Omhändertagna personer 1<br />Tips/Telefonsamtal Om brott m.m. från medborgare 24<br />Kontrollerade Personer/Fordon 33<br />Kontrollerad fest 1</p></p><p><p><br /><strong>ETT URVAL AV HÄNDELSER OCH ANMÄLDA BROTT</strong> Antal<br />Olika former av bedrägerier via Tfn och Internet 4<br />Utpressning 3<br />Stöld ur bil 1<br />Viltolyckor 2</p></p><p><p><strong>Anmäla brott eller tipsa polisen</strong> :<br />Ring 114 14 eller på bifogad länk kan du tipsa polisen, finns på Polisen.se :<br />https://polisen.se/kontakt/mejla-region-Mitt/<br /><strong>Pågående brott / färsk gärning: Ring 112</strong></p></p><p></p>",
