    "description": "Gammelgården, resultat efter trafikkontroll",
    "content": "<p>Patrullen uppmärksammade en bilist som inte verkade vilja stanna i trafikkontrollen. Patrullen körde därför efter bilisten och stoppade föraren för kontroll.</p>\n<p>Föraren visade sig sakna körkort och misstänks för grov olovlig körning. Bilen var avställd och hade körförbud.</p>\n<p>Bilen togs i beslag med stöd av trafikbrottslagen 7§. Det innebär att ett fordon som använts vid brott får förklaras förverkat, om det behövs för att förebygga fortsatt sådan brottslighet och förverkandet inte är uppenbart oskäligt.</p>",
