    "description": "Inbrott i lägenhet.",
    "content": "<p>11.33 Polisen fick samtal om att det hade varit inbrott i en lägenhet i centrala Värnamo. Någon hade brutit upp en dörr. Lägenheten hade stått tom i någon timme.</p>\n<p>11.50 Polis på plats.</p>\n<p>Patrullen gjorde en teknisk undersökning och kunde säkra vissa spår. Polisen har också genomfört dörrknackning i området, samt tagit uppgifter för en anmälan om grov stöld. Det är oklart vad som kan ha stulits, och det finns i nuläget ingen misstänkt.</p>",
