    "description": "En olycka har skett i höjd med Backaviadukten.",
    "content": "<p>SOS-alarm meddelar att flera fordon har krockat i höjd med Backaviadukten.</p>\n<p>Det är oklart om någon person har blivit skadad i samband med olyckan.</p>\n<p>Polisen är på väg till platsen för att undersöka vad som har hänt.</p>\n<p>UPPDATERING kl. 12.56</p>\n<p>Det verkar ha gått bra med de inblandade personerna. Två personer uppges vara lindrigt skadade.</p>\n<p>Det är däremot hinder i trafiken i nuläget.</p>\n<p>Olyckan har skett i i riktning mot Kupolen från Falun. En bilist i mötande körriktning har av någon anledning kommit över på fel vägbana.</p>\n<p>UPPDATERING kl. 13.07</p>\n<p>En bilist, en man i 30-årsåldern, har fått åka med ambulansen till sjukhus med smärta i bröstet. Även passageraren i den bilen fick åka med ambulans till sjukhus för kontroll.</p>\n<p>UPPDATERING kl. 13.16</p>\n<p>Polisen har nu lämnat platsen och bilarna är bärgade.</p>\n<p>I nuläget är det oklart om det har skett något brott i samband med olyckan.</p>",
