    "description": "Lastbil i diket på riksväg 56 norr om Äs.",
    "content": "<p>12.07 SOS-larm till polisen om trafikolycka på riksväg 56 ett par kilometer norr om Äs. enligt inringare till SOS ska en lastbil ha kört ner ett par stolpar och sedan hamnat i diket. Ingen person verkar skadad.</p>\n<p>12.30 polisen är framme på olycksplatsen.</p>\n<p>Uppdatering kommer.</p>\n<p>12.50 bärgare är på plats för att förbereda bärgningen som kan bli långdragen och komplicerad. Trafiken dirigeras växelvis förbi olycksplatsen. Trafikanter uppmanas att om möjligt välja annan väg.</p>\n<p>15.15 Föraren, en man i 65-årsåldern, har gripits. Han är misstänkt för drograttfylleri, vårdslöshet i trafik och ringa narkotikabrott eget bruk. Gripandet kan motiveras med att han är utländsk medborgare och att det därmed finns en flyktrisk.</p>",
