    "content": "<p>SOS-alarm meddelar att en person har trillat ned från ett tak i samband med arbete på en villa.</p>\n<p>Polisen har varit på plats och det visar sig att en man i 55-årsåldern har arbetat med en skorsten på taket till en villa. Av okänd anledning har mannen trillat ner från taket.</p>\n<p>Det handlar om ett fall på ca 4 meter. Mannen är förd med ambulans till sjukhus med, vad det verkar, allvarliga skador.</p>\n<p>I nuläget är det oklart vilken typ av anmälan patrullen kommer att skriva om händelsen.</p>\n<p>UPPDATERING kl. 10.57</p>\n<p>Mannen har halkat på taket och i samband med det har han trillat ner på marken.</p>\n<p>Patrullen har varit i kontakt med en miljöbrottsåklagare som har inlett en förundersökning gällande arbetsmiljöbrott genom vållande till kroppsskada. Det finns ingen misstänkt i detta ärende i nuläget.</p>",
