    "title_location": "Jämtlands län",
    "description": "Viltolyckor i Jämtlands län under morgonen.",
    "content": "<p>Klockan 07:08: Samtal om viltolycka med älg på länsväg 644 I Fångåmon, Åre. Ingen person kom till skada. Det är oklart om älgen skadades, en eftersöksjägare kallas ut. </p>\n<p>Klockan 07:08: Samtal om en vilolycka med rådjur på länsväg 321 ovan fotbollsplanen i Galhammar, Svenstavik. Inga personskador uppkom. Det är oklart om rådjuret skadades, det sprang från platsen efter olyckan. Eftersöksjägare kallas till platsen. </p>\n\n<p><strong>Så minimerar du risken för viltolyckor</strong><br />Anpassa hastigheten<br />Din hastighet är direkt avgörande för hur allvarligt det behöver bli när ett djur kliver upp på vägen. Har du anpassat din hastighet till underlag och din sikt?</p>\n<p><br />Anpassa avståndet<br />Ligger du för nära fordonet framför minskar ditt vidvinkelseende och får svårare att se rörelser i skogsbrynet.</p>\n<p><br />Lär dig om djurens beteende<br />Finns det mer olycksdrabbade sträckor där du ska åka? Har du extra koll i gryning och skymning? Läs på om tips via viltolycka.se.</p>\n<p><strong>Om olyckan ändå sker</strong><br />Ring 112<br />Ring 112 och anmäl viltolyckan. I det läget ska du inte använda polisens telefonnummer 114 14.</p>\n<p><br />Ta hand om eventuella skadade<br />Se till att eventuellt skadade får första hjälpen i väntan på ambulans.</p>\n<p><br />Markera platsen<br />Vid en viltolycka ska du alltid märka ut platsen. Gärna med viltremsa. Se till att polisen har korrekta koordinater. Förslagsvis finns en funktion för det i Nationella Viltolycksrådets app.</p>\n",
