    "description": "Flera trafikolycka under morgonen i Jönköpings län.",
    "content": "<p>07.27 Det kom larm om en trafikolycka i Göteborgsbacken på riksväg 40 i Jönköping, i riktning mot Göteborg. Två bilar hade krockat, sedan ska ytterligare en bil ha kört in i den krocken. Det rapporterades om mycket halt väglag.</p>\n<p>07.35 Polis på plats. Inga personskador fanns att rapportera, men tre personbilar behövde bärgas från platsen. Även en lastbil var inblandad, den hade fått punktering. Olyckan ska ha börjat med att en av bilister fick sladd, vilket ledde till kollisioner med övriga.</p>\n<p>07.36 SOS-larm till polisen om trafikolycka på riksväg 31/40/47 i södergående riktning där en bilist ska ha kört in i ett vägräcke i Järabacken. En person i bilen, vaken och talbar. Visade sig senare vara utanpersonskador och bilen kunde köras från platsen. Trafikverket underrättas om skador på vägräcket. Ingen misstanke om brott.</p>\n<p>08.09 SOS-larm till polisen om trafikolycka på riksväg 26 i Prinseryd. Fyra bilar ska vara inblandade och det är mycket halt på platsen. Två bilar av dem ska ha hamnat i diket. Totalstopp 08.16. Fyra drabbade och en av dem har nacksmärta. En kvinna förd till sjukhus med ambulans på grund av nacksmärta. Ingen misstanke om brott.</p>\n<p>08.18 SOS-larm om trafikolycka på riksväg 40 Rogeberga angående en buss som kört i diket. Visade sig vara en buss utan passagerare som glidit ner i diket. Mycket halt på platsen.</p>\n<p>08.23 SOS-larm om trafikolycka på riksväg 40 i Göteborgsbacken, där en bilist kört in i vägräcke på nästan samma plats om den tidigare olyckan. Visar sig vara två bilar inblandade utan allvarliga skador.</p>\n<p>Polisen har nu tagit emot larm om 8 trafikolyckor i Jänköpings län. I alla dessa fall har det rapporterats att det har varit halt på vägen. Lyckligtvis verkar ännu ingen trafikant ha skadats allvarligt.</p>\n\n\n\n",
    "content_formatted": "<p><p>07.27 Det kom larm om en trafikolycka i Göteborgsbacken på riksväg 40 i Jönköping, i riktning mot Göteborg. Två bilar hade krockat, sedan ska ytterligare en bil ha kört in i den krocken. Det rapporterades om mycket halt väglag.</p></p><p><p>07.35 Polis på plats. Inga personskador fanns att rapportera, men tre personbilar behövde bärgas från platsen. Även en lastbil var inblandad, den hade fått punktering. Olyckan ska ha börjat med att en av bilister fick sladd, vilket ledde till kollisioner med övriga.</p></p><p><p>07.36 SOS-larm till polisen om trafikolycka på riksväg 31/40/47 i södergående riktning där en bilist ska ha kört in i ett vägräcke i Järabacken. En person i bilen, vaken och talbar. Visade sig senare vara utanpersonskador och bilen kunde köras från platsen. Trafikverket underrättas om skador på vägräcket. Ingen misstanke om brott.</p></p><p><p>08.09 SOS-larm till polisen om trafikolycka på riksväg 26 i Prinseryd. Fyra bilar ska vara inblandade och det är mycket halt på platsen. Två bilar av dem ska ha hamnat i diket. Totalstopp 08.16. Fyra drabbade och en av dem har nacksmärta. En kvinna förd till sjukhus med ambulans på grund av nacksmärta. Ingen misstanke om brott.</p></p><p><p>08.18 SOS-larm om trafikolycka på riksväg 40 Rogeberga angående en buss som kört i diket. Visade sig vara en buss utan passagerare som glidit ner i diket. Mycket halt på platsen.</p></p><p><p>08.23 SOS-larm om trafikolycka på riksväg 40 i Göteborgsbacken, där en bilist kört in i vägräcke på nästan samma plats om den tidigare olyckan. Visar sig vara två bilar inblandade utan allvarliga skador.</p></p><p><p>Polisen har nu tagit emot larm om 8 trafikolyckor i Jänköpings län. I alla dessa fall har det rapporterats att det har varit halt på vägen. Lyckligtvis verkar ännu ingen trafikant ha skadats allvarligt.</p></p><p></p>",
