    "description": "Ett urval av nattens polisverksamhet i Norrbottens län.",
    "content": "<p>Det har varit en natt med låg arbetsbelastning. Polisen har även utfört ett flertal kontroller av personer och fordon som inte resulterat i någon brottsmisstanke.</p>\n<p>Här följer ett urval av nattens händelser:</p>\n<p><strong>22:18 Stöldförsök, Kalix</strong><br />Polisen får ett samtal om en pågående slangning av bränsle ur en skogsmaskin strax utanför Kalix. Polisen åker dit och då finns fyra misstänkta personer kvar på platsen, tre män och en kvinna i 20-årsåldern. Polisen håller förhör och upprättar anmälan gällande försök till stöld.</p>\n<p><strong>00:23 Olovlig körning, Gällivare</strong><br />Polisen stoppar och kontrollerar en personbil i centrala Gällivare. Föraren, en man i 30-årsåldern, saknar behörighet att köra då hans körkort är återkallat. En anmälan gällande grov olovlig körning upprättas. </p>\n<p><strong>Övrigt:</strong> En viltolycka har inträffat i länet under tidig morgon, i Överkalix kommun. Ingen person kom till skada. </p>",
