    "description": "Ett urval av nattens polisverksamhet.",
    "content": "<p>Det har varit en natt med låg arbetsbelastning. Polisen har utöver nedanstående ärenden även utfört ett flertal kontroller av personer och fordon som inte resulterat i någon brottsmisstanke.</p>\n<p>Här följer ett urval av nattens händelser:</p>\n<p><strong>23:24 Skadegörelse, Kramfors</strong><br />Polisen kontaktas angående att flera personer ses göra åverkan på en dörr till resecentrum i Kramfors. Polisen åker till platsen och påträffar där en av personerna, en man i 50-årsåldern, som misstänks för skadegörelsen. En anmälan upprättas. </p>\n<p><strong>01:02 Drograttfylleri, Sundsvall</strong><br />Polisen stoppar och kontrollerar en personbil i Bredsand. Föraren, en man, visar tecken på drogpåverkan och tas med för provtagning. Han misstänks för drograttfylleri. En anmälan upprättas också gällande grov olovlig körning då han saknar behörighet att köra och upprepat har kört utan behörighet.</p>\n<p><strong>Övrigt:</strong> En viltolycka har inträffat i länet under sen kväll, i Hallsta, Ånge kommun. Ingen person kom till skada. </p>",
