    "description": "Sammanfattning av nattens polisverksamhet i polisområde Jönköping.",
    "content": "<p>07.00 polisen har hittills detta dygn hanterat ett 25-tal rutinärenden, huvudsakligen utan brottsmisstankar. Ingen har frihetsberövats av något skäl.</p>\n<p>02.03 SOS-larm till polisen om trafikolycka på länsväg 152 vid Hillerstorp. En bilist ska enligt SOS kört in i ett träd. Polisen åkte till olycksplatsen, som var belägen i Gnosjö kommun mellan Hillerstorp och Kulltorp. En drabbad person klagade på smärta i nacke, axel och ben och fördes till sjukhus i ambulans. Polisen åkte till sjukhuset och höll förhör med föraren, som är en man i 25-årsåldern. Det finns inledningsvis ingen brottsmisstanke.</p>\n<p>02.11 samtal till polisen om personer som uppträdde misstänkt i Skillingaryd. Polisen åkte till platsen och fick misstankar om brott mot knivlagen och ringa narkotikabrott genom innehav. Den som misstänkt är en man i 40-årsåldern.</p>\n<p>06.27 SOS-larm till polisen om trafikolycka i Hedentorp, Axamo. Två bilar ska ha krockat. När polisen kom till platsen var det mycket halt på körbanan. Ingen person har skadats och det finns ingen brottsmisstanke.</p>\n<p>06.43 SOS-larm till polisen om trafikolycka på riksväg 40 i Rogberga. Inga skador och inget behov av polis på platsen. Polisen hjälpte den drabbade att kalla på bärgare. Halt på platsen.</p>\n<p>06.48 SOS-larm till polisen om trafikolycka på riksväg 47 i Mullsjö där en bilist kört in i ett träd eller en stolpe och voltat. Enligt uppgifter till polisen ska det vara halt på platsen. Polisen är på väg till platsen. En förare fördes till sjukhus med ambulans, oklart skadeläge. Ingen misstanke om brott.</p>\n<p>Det finns inga andra brott eller allvarliga händelser att rapportera om.</p>\n\n\n",
