    "description": "Sammanfattning av nattens polisverksamhet i polisområde Södermanland.",
    "content": "<p>06.08 polisen har hittills detta dygn hanterat ett 30-tal rutinärenden, huvudsakligen utan brottsmisstankar. Ingen har gripits, en har omhändertagits för berusning/ordningsstörning. Ingen har fött följa med för provtagning.</p>\n<p>01.50 vid kontroll av en person på Kungsgatans industriområde i Eskilstuna upptäcktes att han bar på en kniv. Polisen tog kniven i beslag och mannen, som är i 30-årsåldern, är nu misstänkt för brott mot knivlagen.</p>\n<p>04.14 en polispatrull, som befann sig på Vilsta industriområde i Eskilstuna upptäckte att någon hade klippt upp ett staket till ett inhägnat område som disponeras av polisen. När polispatrullen undersökte närmare anträffades två personer sovande i en husvagn som står uppställd på området. De båda sovande personerna är en kvinna i 50-årsåldern och en man i 55-årsåldern och de avvisades från platsen efter att de identifierats. Det fanns inte skäl att frihetsberöva de misstänkta eftersom de sannolikt inte skulle bli anhållna av åklagare. De båda är nu misstänkta för olaga intrång på området, överträdelse av myndighets bud genom att ta sig in olovligt i en husvagn som är tagen i beslag samt skadegörelse på det uppklippta staketet.</p>\n<p>Det finns inga andra brott eller allvarliga händelser att rapportera om.</p>\n\n\n",
