    "content": "<p>Det har varit en natt med låg arbetsbelastning. Polisen har även utfört ett flertal kontroller av personer och fordon som inte resulterat i någon brottsmisstanke.</p>\n<p>Här följer ett urval av nattens händelser:</p>\n<p><strong>22:08 Trafikkontroll, Lycksele</strong><br />Under torsdagskvällen kontrollerade polisen trafiken på två platser i Lycksele. Först upprättades en kontroll på E12/Båtvägen, Furuvik där hastigheten kontrollerades. Samtliga höll hastigheten. <br />Därefter upprättades en kontroll på länsväg 365, Södermalm. Även här höll samtliga trafikanter hastigheten. </p>\n<p><strong>Övrigt:</strong> En viltolycka har inträffat i länet under natten, i Tvärålund, Vindelns kommun. Ingen person kom till skada. </p>",
