    "content": "<p><strong>02.30 Lilla Edet, inbrott i bostad</strong><br />Vid Sätergården är det en kvinna som konstaterar att det varit inbrott i hennes lägenhet. Det saknas bland annat guld.</p>\n<p><strong>03.00 Göteborg, inbrott i butik</strong><br />Vid Övre Husargatan är det två personer som krossar ett skyltfönster till en cykelbutik och stjäl en cykel som stod innanför skyltfönstret. De försvinner från platsen på en moped.</p>\n<p><strong>04.59 Göteborg, inbrott i förråd</strong><br />Vid Borraregatan i Krokslätt är det två personer som gör inbrott i ett förråd och försvinner sedan från platsen. Vid förrådet anträffas en bil som inte hör hemma på adressen och i denna ses brottsverktyg och gods som misstänks vara stulet. Detta tas i beslag. Det som stulits från förrådet är med största sannolikhet sprit. Ingen gripen.</p>\n<p><strong>05.45 Ulricehamn, trafikolycka</strong><br />Vid Jönköpingsvägen är det en bilist som kör av vägen och in i ett hus. Tre personer i bilen och ingen av dom var ibehov av sjukhusvård.</p>\n\n",
